script: |
  super -f tsv -I q6321.sql | sort > q6321.out

vector: true

inputs:
  - name: q6321.sql
    data: |
      SELECT DISTINCT - ( + - COUNT ( * ) ) / - CAST ( MAX ( col2 ) AS INTEGER ) * - 70 + COUNT ( * ) + - + 72 AS col1 FROM tab1 WHERE NOT - col2 = - - col2 * - col1 + col1;
  - name: tab1

outputs:
  - name: q6321.out
    data: |
      -69
